// ==UserScript==
// @name         Steam Kur Dönüştürücü
// @namespace    https://github.com/KaptanUfuk
// @version      1.2.1
// @description  Steamden kaldırılan Türk Lirasını göstermek için anlık dolar kuru ile steamdeki oyun fiyatını çarpıp Türk Lirası cinsinden gösterir.
// @author       KaptanUfuk
// @license      MIT
// @icon         data:image/png;base64,
// @match        https://*.steampowered.com/*
// @grant        GM_xmlhttpRequest
// @downloadURL https://update.greasyfork.org/scripts/480551/Steam%20Kur%20D%C3%B6n%C3%BC%C5%9Ft%C3%BCr%C3%BCc%C3%BC.user.js
// @updateURL https://update.greasyfork.org/scripts/480551/Steam%20Kur%20D%C3%B6n%C3%BC%C5%9Ft%C3%BCr%C3%BCc%C3%BC.meta.js
// ==/UserScript==

(function() {
    'use strict';

    var dolarapi = 'https://finans.truncgil.com/today.json';

    function dolarcek() {
        return new Promise((resolve, reject) => {
            GM_xmlhttpRequest({
                method: "GET",
                url: dolarapi,
                onload: function(response) {
                    var data = JSON.parse(response.responseText);
                    var dolarKuru = parseFloat(data.USD.Satış).toFixed(4);
                    resolve(dolarKuru);
                },
                onerror: function(error) {
                    reject(error);
                }
            });
        });
    }

    dolarcek().then(dolarKuru => {

        var fiyatindirimyokken = document.querySelectorAll('.game_purchase_price');
        var fiyatasil = document.querySelectorAll('.discount_original_price');
        var fiyatindirimli = document.querySelectorAll('.discount_prices .discount_final_price');
        var fiyatdlc = document.querySelectorAll('.game_area_dlc_price');
       // var fiyatarama = document.querySelectorAll('.match_subtitle');

        turklirasiyap(fiyatindirimyokken, dolarKuru);
        console.log("indirim yokken olan oyun fiyatı türk lirasına çevirildi");
        turklirasiyap(fiyatasil, dolarKuru);
        console.log("indirim varken olan indirimsiz oyun fiyatı türk lirasına çevirildi");
        turklirasiyap(fiyatindirimli, dolarKuru);
        console.log("indirim varken olan indirimli oyun fiyatı türk lirasına çevirildi");
        turklirasiyap(fiyatdlc, dolarKuru);
        console.log("indirim yokken olan dlc fiyatı türk lirasına çevirildi");

    });

    function turklirasiyap(fiyatlar, dolarKuru) {
        fiyatlar.forEach(function(element) {
            var fiyatyazili = element.textContent.trim();

            var fiyatpara = parseFloat(fiyatyazili.replace(/[^\d.]/g, ''));

            //var yenifiyat = (fiyatpara * dolarKuru).toFixed(2) + " TL";    //DOLAR FİYATI GÖZÜKMESİN İSTİYORSANIZ YORUM SATIRINI SİLİP AŞAĞIDAKİ SATIRI YORUM SATIRI YAPIN
            var yenifiyat = (fiyatpara * dolarKuru).toFixed(2) + " TL ("+fiyatyazili.replace('&','')+")";

            if (fiyatyazili!="Oynaması Ücretsiz" && fiyatyazili!="Free to Play")
            {
                element.textContent = yenifiyat;
            }
        });
    }
})();
